  \"Environmental assessment for studies investigating predator management techniques
  designed to increase duck production on selected refuge island, Clinton County,
  IA; Carroll County, IL and Vernon County, WI\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  10,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:22:26.984268\",\n\t\"name\": \"environmental-assessment-for-studies-investigating-predator-management-techniques-designed\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This unpublished report proposed long-term
  management strategies to enhance waterfowl recruitment on the Upper Mississippi
  River National Wildlife and Fish Refuge (Refuge). Since 1981, studies by R. Nicklaus
  and J. Wetzel of the Wisconsin Department of Natural Resources (WDNR) and R.B. Dahlgren
  of the Fish and Wildlife Service (FWS) have revealed a potential for high levels
  of waterfowl nesting and success on predator-free islands in the Refuge. The Refuge
  has identified the following needs; (1) validate waterfowl nesting responses on
  islands where mammalian predators have been removed, (2) determine costs and evaluate
  effectiveness of selected lethal or nonlethal removal techniques, (3) determine
  which islands should be selected for predator control, and where new islands could
  be constructed, and (4) determine the nature by which raccoons reoccupy islands
  from which they have been removed.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
